import React, { useEffect, useState } from "react";
import axios from "axios";
import { Button } from "@material-ui/core";
import '.App'


function App() {
  const [info, Setinfo] = useState([]);
  const [index, setIndex] = useState(null);
  const fetchData = async () => {
    const infodata = await axios.get("https://reqres.in/api/users?page=2");
    Setinfo(infodata.data.data);
  };
  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div className="App">
      <h1>{index}</h1>



      {info.map((place, i) => (
        <Button className="bt" variant="contained" key={place.id} onClick={() => setIndex(i)}>
          {i + 1}
        </Button>
      ))}
    </div>
  );
}

export default App;
